canonical_solution:
class Solution:
    def generateParenthesis(self, n: int) -> List[str]:
        def dfs(l, r, t):
            if l > n or r > n or l < r:
                return
            if l == n and r == n:
                ans.append(t)
                return
            dfs(l + 1, r, t + '(')
            dfs(l, r + 1, t + ')')

        ans = []
        dfs(0, 0, '')
        return ans

inefficient_solution:
class Solution:
    def generateParenthesis(self, n):
        def dfs(l, r, t, memo):
            if l > n or r > n or l < r:
                return
            if l == n and r == n:
                ans = []
                ans.append(t)
                return ans
            if t in memo:
                return memo[t]
            dfs(l + 1, r, t + '(', memo)
            ans1 = dfs(l, r + 1, t + ')', memo)
            ans = ans1 + [t]
            memo[t] = ans
            return ans

        ans = []
        dfs(0, 0, '', {})
        return ans
